INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (111500301, 0.58, 0, 0.0, 0, 1, 0, 111500303, 0, 2001, 111500304, "コインを持っていない場合、目の前の敵１キャラに物理中ダメージを与える。コインを持っている場合、目の前の敵１キャラに物理中ダメージを与え、さらに味方全体のＴＰ上昇を小アップする。", 111500306, 0, 111500305, 0, 0, 0, 0, 0, 111500302, 0, 0, 0, 0, 1115003, "デストラクション", 0);
