INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (111501301, 0.58, 0, 0.0, 0, 1, 0, 111501303, 0, 2001, 111501304, "短時間全ての物理攻撃を回避する状態になり、コインを持っていない場合、目の前の敵１キャラに物理大ダメージを与える。コインを持っている場合、目の前の敵１キャラに物理大ダメージを与え、味方全体のＴＰ上昇を小アップさせる。さらにコインの有無にかかわらず、バトル終了時まで全てのスキルでコインを持っていない場合とコインを持っている場合の効果が両方発動する状態になる。この状態の間、デストラクション+に自分を中心とした範囲内の味方の行動速度を大アップさせる効果が追加される。", 111501306, 0, 111501305, 0, 111501308, 0, 0, 111501310, 111501302, 0, 111501309, 111501307, 0, 1115013, "デストラクション+", 0);
