INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (133000201, 0.59, 0, 0.0, 0, 0, 0, 133000203, 0, 2001, 133000204, "目の前の敵１キャラに物理大ダメージを与え、自分を中心とした範囲内の味方すべての物理攻撃力を特大アップ、物理クリティカルを大アップさせる。自分に【レイスボディ】が付与されている場合、【レイスボディ】を１つ消費し、追加で目の前の敵１キャラに物理防御力を一定値無視する物理大ダメージを与える。", 133000206, 0, 133000205, 0, 0, 0, 0, 0, 133000202, 0, 0, 133000207, 0, 1330002, "レイスドロップ", 0);
