INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (134600201, 1.05, 0, 0.0, 0, 0, 134600202, 134600203, 0, 2001, 134600204, "目の前の敵１キャラに物理大ダメージを与える。さらにそのキャラを中心とした範囲内の敵すべてに物理中ダメージを与え、物理攻撃力を中ダウン、物理防御力を小ダウンさせる。【フィールド展開中】このスキルのダメージがアップし、目の前の敵１キャラを中心とした範囲内の敵すべてのクリティカルを受けた際のダメージを小アップさせる。", 134600206, 0, 134600205, 0, 134600208, 134600203, 0, 134600210, 134600202, 134600207, 134600209, 134600207, 134600202, 1346002, "クロースぼっちコンバット", 134600203);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (134600301, 1.05, 0, 0.0, 0, 0, 0, 134600303, 134600306, 2013, 134600304, "自分に物理無効バリアを展開し、さらに自分の物理攻撃力を特大アップ、ＴＰ上昇を小アップし、ＴＰを中回復する。【フィールド展開中】味方全体に物理/魔法吸収バリアを展開し、さらに味方全体の物理攻撃力を特大アップ、ＴＰを小回復させる。", 134600306, 0, 134600305, 0, 134600308, 0, 0, 0, 134600302, 134600306, 0, 134600307, 0, 1346003, "ピンポイントぼっちバリア", 0);
