INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (134700201, 0.59, 0, 0.0, 0, 0, 0, 134700203, 0, 2005, 134700204, "物理攻撃を行うすべての味方キャラの物理攻撃力を中アップ、ＨＰ吸収を小アップさせる。自分を中心とした範囲内の味方すべてのＨＰを小回復するフィールドを展開する。さらに、火属性の味方すべてのＨＰを小回復させ、継続ＨＰ回復状態を付与する。物理攻撃力の上昇量は、自分を除く味方の残りＨＰに応じて最大５倍までアップする。", 134700206, 0, 134700205, 0, 0, 0, 0, 0, 134700202, 0, 0, 134700207, 0, 1347002, "リカバリーオブフェニクス", 0);
