INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135010101, 1.05, 0, 0.0, 0, 0, 0, 135010103, 0, 2003, 135010104, "ＨＰが０になった時に発動し、倒れずに自分の【いばらの冠】とステータスダウン効果を全て解除してＨＰを大回復させる。さらに、バトル終了時まで味方全体の魔法攻撃力を極大アップ、魔法防御力を大アップ、魔法クリティカルを特大アップ、魔法攻撃クリティカル時のダメージを中アップ、魔法攻撃のダメージを小アップさせ、調和状態を付与する。調和状態の間は物理防御力と魔法防御力のうち高い方によって計算されたダメージを受ける。このスキルはバトル中一度しか発動しない。", 135010106, 0, 135010105, 0, 135010108, 0, 0, 135010110, 135010102, 0, 135010109, 135010107, 0, 1350101, "アナスタシス", 0);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135010201, 1.05, 0, 0.0, 0, 0, 0, 135010203, 0, 2017, 135010204, "バトル終了時まで自分に【いばらの冠】を付与し、物理防御力と魔法防御力とＴＰ上昇を極大ダウンする。", 0, 0, 135010205, 0, 0, 0, 0, 0, 135010202, 0, 0, 0, 0, 1350102, "シネスティマ", 0);
