INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135100101, 0.0, 0, 0.0, 0, 0, 0, 135100103, 0, 1001, 135100104, "目の前の敵１キャラの物理防御力を小ダウンさせ、物理大ダメージを与える。さらに、自分のＨＰを中回復する。【ぐずぐず】が４つ以上付与されている場合、【ぐずぐず】を４つ消費して自分を中心とした範囲内の味方すべての物理攻撃力を特大アップさせ、このスキルのダメージがアップし、目の前の敵１キャラに追加の物理特大ダメージを与える。【ぐずぐず】を４つ消費した場合、このスキルのダメージは物理防御力を一定値無視し、必ずクリティカルする。", 135100106, 0, 135100105, 0, 135100108, 0, 0, 135100110, 135100102, 0, 135100109, 135100107, 135100109, 1351001, "夏舞・騎遊氷竜", 0);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135100201, 1.05, 0, 0.0, 135100201, 0, 135100201, 135100203, 0, 2004, 135100204, "目の前の敵１キャラに物理大ダメージを与え、物理攻撃力と魔法攻撃力を大ダウン、物理防御力を小ダウンさせる。さらに、自分を中心とした範囲内の味方すべての物理攻撃力を大アップさせる。", 0, 0, 135100205, 0, 0, 0, 0, 0, 135100202, 0, 0, 0, 0, 1351002, "氷菓", 135100201);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135100301, 1.05, 0, 0.0, 0, 0, 0, 135100303, 0, 2012, 135100304, "【挑発】敵全体を挑発し、自分に物理ダメージカット効果と魔法ダメージカット効果を付与する。さらに、自分を中心とした範囲内の味方すべての物理攻撃力を大アップ、物理防御力と魔法防御力を中アップ、ＨＰとＴＰを小回復させるフィールドを展開する。", 135100306, 0, 135100305, 0, 135100308, 0, 0, 0, 135100302, 0, 0, 135100307, 0, 1351003, "汐沓", 0);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135110101, 1.05, 0, 0.0, 0, 0, 0, 0, 0, 2017, 0, "敵から攻撃を受けた時に発動し、自分に【ぐずぐず】を１つ付与する。【ぐずぐず】は最大８つまで追加される。", 0, 0, 0, 0, 0, 0, 0, 0, 135110102, 0, 0, 0, 0, 1351101, "絶対に赤ちゃん化しない！", 0);
