INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135300201, 1.05, 0, 0.0, 0, 0, 0, 135300203, 0, 2001, 135300204, "目の前の敵１キャラに物理大ダメージを与え、物理防御力を小ダウンさせる。さらに追加の物理中ダメージを与え、味方全体の魔法防御力を小アップさせる。このスキルの効果量は味方の数に応じて変化する。", 135300206, 0, 135300205, 0, 135300208, 0, 0, 0, 135300202, 0, 0, 135300207, 0, 1353002, "水やりショット", 135300202);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135300301, 1.05, 0, 0.0, 0, 0, 0, 135300303, 0, 2003, 135300304, "味方全体の物理攻撃力を特大アップ、物理クリティカルを大アップさせ、一番前の味方１キャラに【プルメリアのお守り】を２つ付与する。さらに、自分のＴＰを中回復する。【プルメリアのお守り】が付与されている間に１回ダメージを受けると【プルメリアのお守り】を１つ消費してダメージを無効化し、同時に敵に物理中ダメージを与える。このスキルの物理攻撃力アップ、物理クリティカルアップの効果量とダメージとＴＰの回復量は味方の数に応じて変化する。", 135300306, 0, 135300305, 0, 135300308, 0, 0, 0, 135300302, 0, 135300309, 135300307, 0, 1353003, "夏バテ防止です", 0);
