INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135400301, 1.05, 0, 0.0, 0, 0, 0, 135400303, 0, 2003, 135400304, "味方全体の物理防御力と魔法防御力を小アップさせ、行動速度を大アップさせる。さらに、光属性の味方すべてのＨＰとＴＰを小回復させる。バトル開始後、初弾のこのスキルは、光属性の味方の数に応じてＴＰの回復量が最大５倍までアップする。", 135400306, 0, 135400305, 0, 135400308, 0, 0, 0, 135400302, 0, 0, 135400307, 0, 1354003, "サマーネクター", 0);
