INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135700201, 0.74, 0, 0.0, 0, 0, 0, 135700203, 0, 2003, 135700204, "闇属性の味方すべての物理クリティカルを大アップ、物理攻撃クリティカル時のダメージを小アップさせ、ＨＰを中回復させる。バトル開始後初めてこのスキルを使用した後、10回ダメージを与えるたびに、最大10回まで闇属性の味方すべての物理攻撃力を大アップさせる。さらに100回ダメージを与えた時、【サラサリアンステップ】を獲得する。", 135700206, 0, 135700205, 0, 135700208, 0, 0, 135700210, 135700202, 0, 135700209, 135700207, 0, 1357002, "流麗キャットステップ", 0);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (135700301, 0.74, 0, 0.0, 0, 0, 135700302, 135700303, 0, 2006, 135700304, "目の前の敵１キャラに物理大ダメージを与え、物理防御力を小ダウンさせる。対象の敵が継続ダメージ状態だった場合、このスキルのダメージのヒット数が増加する。【サラサリアンステップ】を獲得していない場合、闇属性の味方すべてのＴＰを小回復させ、獲得している場合、闇属性の味方すべての物理攻撃クリティカル時のダメージを小アップ、ＴＰを中回復させる。", 135700306, 135700308, 135700305, 0, 135700308, 135700304, 0, 0, 135700302, 0, 135700309, 135700307, 0, 1357003, "サラサリアンラッシュ", 0);
