INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (433801201, 1.0, 0, 0.0, 0, 0, 0, 433801203, 0, 2006, 433801204, "グレゴール以外の味方すべてのＴＰ上昇を小アップさせ、ＴＰを小回復させる。さらにグレゴールのＴＰを全て消費し、消費した量に応じてグレゴール以外の闇属性の味方すべてのＴＰを回復する。", 0, 0, 433801205, 0, 0, 0, 0, 0, 433801202, 0, 0, 0, 0, 4338012, "グレゴリアライト", 0);
INSERT INTO `v1_e09afb25d7c29a3ad4c66a6392739dcf98ac835c09627ed1473dfc9f56d53c54` VALUES (433801301, 1.0, 0, 0.0, 433801301, 0, 433801302, 433801303, 0, 2002, 433801304, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法大ダメージを与え、ＴＰを小ダウンさせ、グレゴールのＨＰとＴＰを小回復する。また、グレゴール以外の味方すべての魔法攻撃力と魔法クリティカルを大アップさせる。グレゴール以外の闇属性のキャラに対してはこの効果が２回発動する。", 433801306, 0, 433801305, 0, 433801308, 0, 0, 0, 433801302, 0, 433801309, 433801307, 0, 4338013, "妖精の羽ばたき", 0);
